start_2 : "<u>เดนเดฒเต {0}!</u>\n\n<u>เดเดพเตป {1}, เดจเดฟเดเตเดเดณเตเดเต เดชเตเดคเดฟเดฏ เดธเดเดเตเดค เดเตเดเตเดเดพเดฏเตเดฎ.</u>\n\n<u>๐ง เดเดพเดจเดเตเดเดณเดฟเตฝ เดเดเตเดเดพเดคเดฟเดเดณเดพเดเดพเตป เดคเดฏเตเดฏเดพเดฑเดพเดฃเต?</u>\nโ เดเดพเดจเตเดฐเต เดถเดเตเดคเดฎเดพเดฏ เดชเตเดฐเดญเดพเดตเดฎเตเดณเตเดณ เดเตเดฒเดฟเดเตเดฐเดพเด เดธเดเดเตเดค เดชเตเดฒเตเดฏเตผ เดฌเตเดเตเดเต เดเดฃเต เดเตเดเดฟเดฒเตเด เดเดฟเดฒ เดเดคเดฟเดธเดจเตเดงเดฟ เดธเดตเดฟเดถเตเดทเดคเดเดณเตเดฎเดพเดฏเดฟ. เดจเดฟเดเตเดเดณเตเดเต เดฆเดฟเดจเด เดธเดเดเตเดคเดชเตเตผเดฃเตเดฃเดฎเดพเดเตเดเดพเด!\n\n<u>โ เดเดจเตเดจเต เดเดเตเดเดจเต เดเดชเดฏเตเดเดฟเดเตเดเดพเดฎเตเดจเตเดจเต เดฎเดจเดธเตเดธเดฟเดฒเดพเดเตเดเดพเตป เดธเดนเดพเดฏเด เดตเตเดฃเต?</u>\nโ เดเดจเตเดฑเต เดฎเตเดกเตเดฒเตเดเดณเตเด เดเดฎเดพเตปเดกเตเดเดณเตเด เดฒเดญเดฟเดเตเดเตเดจเตเดจเดคเดฟเดจเต เดธเดนเดพเดฏเด เดเดฎเดพเตปเดกเตเดเตพ เดฌเดเตเดเตบ เดเตเดฒเดฟเดเตเดเต เดเตเดฏเตเดฏเตเด."
